const Form = () => (
  <div className="form">
    <div className="form-inputs">
      <input placeholder="Header" />
      <input placeholder="Message" />
    </div>
    <div className="file-input">
      <input placeholder="Choose file" type="file" />
    </div>
  </div>
);
export default Form;
